import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const UserDashboardPage = () => {
  const navigate = useNavigate();
  const storedProfile = localStorage.getItem("profile");
  const profile = storedProfile ? JSON.parse(storedProfile) : null;

  const avatarUrl = profile?.imageUrl || null;

  const [menuOpen, setMenuOpen] = useState(false);
  const [activeTab, setActiveTab] = useState("home"); // "home" | "profile"

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("profile");
    navigate("/"); // redirect to homepage
  };

  return (
    <div className="min-h-screen flex flex-col bg-slate-900">
      {/* Top bar */}
      <header className="w-full flex items-center justify-between px-8 py-3 bg-slate-900 text-white relative">
        <h1 className="text-2xl font-semibold">CareerConnect</h1>

        <div className="flex items-center gap-4 relative">
          <div className="flex items-center bg-white rounded-full px-3 py-1">
            <span className="text-gray-500 mr-2">üîç</span>
            <input
              type="text"
              placeholder="Search"
              className="bg-transparent outline-none text-sm text-gray-700"
            />
          </div>

          {/* menu button */}
          <button
            className="text-2xl font-bold relative"
            onClick={() => setMenuOpen((prev) => !prev)}
          >
            ‚ò∞
          </button>

          {/* dropdown */}
          {menuOpen && (
            <div className="absolute right-0 top-10 bg-white text-gray-800 rounded-md shadow-lg py-2 w-32 z-10">
              <button
                onClick={handleLogout}
                className="w-full text-left px-4 py-2 text-sm hover:bg-gray-100"
              >
                Logout
              </button>
            </div>
          )}
        </div>
      </header>

      <div className="flex flex-1">
        {/* Left sidebar */}
        <aside className="w-52 bg-slate-900 text-white pt-6">
          <div className="flex flex-col items-center mb-6">
            {avatarUrl ? (
              <img
                src={avatarUrl}
                alt="Profile"
                className="w-14 h-14 rounded bg-slate-700 mb-2 object-cover"
                onError={(e) => {
                  e.currentTarget.style.display = "none";
                }}
              />
            ) : (
              <div className="w-14 h-14 rounded bg-slate-700 mb-2" />
            )}
            <span className="text-xs text-gray-300">
              {profile?.name || "User"}
            </span>
          </div>

          <nav className="flex flex-col text-sm">
            <button
              className={`text-left px-4 py-2 ${
                activeTab === "home" ? "bg-indigo-600" : "hover:bg-slate-800"
              }`}
              onClick={() => setActiveTab("home")}
            >
              Home
            </button>
            <button className="text-left px-4 py-2 hover:bg-slate-800">
              Applied Jobs
            </button>
            <button className="text-left px-4 py-2 hover:bg-slate-800">
              Followed Jobs
            </button>
            <button className="text-left px-4 py-2 hover:bg-slate-800">
              Messages
            </button>
            <button className="text-left px-4 py-2 hover:bg-slate-800">
              Query Forum
            </button>
            <button
              className={`text-left px-4 py-2 ${
                activeTab === "profile" ? "bg-indigo-600" : "hover:bg-slate-800"
              }`}
              onClick={() => setActiveTab("profile")}
            >
              Profile
            </button>
          </nav>
        </aside>

        {/* Main area */}
        <main className="flex-1 bg-gradient-to-b from-gray-100 to-gray-300 p-6">
          {activeTab === "profile" && profile ? (
            <div className="max-w-3xl mx-auto bg-white rounded-md shadow p-6">
              <h2 className="text-lg font-semibold mb-4">
                User Information
              </h2>

              <div className="flex justify-center mb-4">
                {avatarUrl && (
                  <img
                    src={avatarUrl}
                    alt="Profile"
                    className="w-24 h-24 rounded-full object-cover"
                  />
                )}
              </div>

              <div className="border rounded-md overflow-hidden text-sm">
                <div className="flex border-b px-4 py-2">
                  <span className="w-40 font-medium">Name:</span>
                  <span>{profile.name}</span>
                </div>
                <div className="flex border-b px-4 py-2">
                  <span className="w-40 font-medium">Email:</span>
                  <span>{profile.email}</span>
                </div>
                <div className="flex border-b px-4 py-2">
                  <span className="w-40 font-medium">Phone:</span>
                  <span>{profile.mobile}</span>
                </div>
                <div className="flex border-b px-4 py-2">
                  <span className="w-40 font-medium">Gender:</span>
                  <span>{profile.gender}</span>
                </div>
                <div className="flex border-b px-4 py-2">
                  <span className="w-40 font-medium">Student Type:</span>
                  <span>{profile.studentType}</span>
                </div>
                <div className="flex px-4 py-2">
                  <span className="w-40 font-medium">Department:</span>
                  <span>{profile.department}</span>
                </div>
              </div>
            </div>
          ) : (
            <div className="w-full h-full flex items-center justify-center text-gray-600">
              <p>Welcome to your dashboard.</p>
            </div>
          )}
        </main>
      </div>
    </div>
  );
};

export default UserDashboardPage;
